import React, {useRef} from "react";
import { SubMenuListItem } from "./SubMenuListItem";


export function SubMenuList({subMenu}){
    const menu = useRef()

    var showMenu = ()=> {
        menu.current.classlist.add("sub-menu-options-show"); 
    };

    if(subMenu){
        return (
            <ul ref={menu} className="full-width menu-principal sub-menu-options sub-menu-options-show">
                {subMenu.map((subMenuItem,index) =>(<SubMenuListItem key={index} menuSubItem={subMenuItem}/>))}
            </ul>
        )
    }
}
